import React from 'react';

const ImageList =  (props) => {
    const images=props.images.map((image) => {
        return <div className="two column wide"><img style={{height : '100px', width: '100px'}} src={image.urls.regular} alt={image.description} key={image.id}/></div>
    })

    return (
        <div className="ui grid">
            {images}

        </div>

    )
}

export default ImageList;
